import Link from "next/link";

export default function Navbar () {
  const styles = {
    display: "flex",
    background: "grey",
    justifyContent:"space-between",
    padding:"1rem"
  };
  return (
    <div style= {styles}>
      <Link href="/"> 
        <a>Home Page</a>
      </Link>
      <Link href="/about"> 
        <a>About Page</a>
      </Link>
      <Link href="/contact">
        <a>Contact Page</a>
      </Link>
    </div>
  )
}
